import { BACKEND_API_URL } from '../actions/types';
import AuthService from '../util/AuthService';
import axios from 'axios';
import swal from 'sweetalert';

export default class TwitterExploreSearchRequestMethod {
    constructor() {
        this.Auth = new AuthService();
    }

    searchTweets(props, searchInputString) {
        props.addNewTweet("<div class='spinner-border text-primary twitter-explore-search-spinner' role='status'><span class='sr-only'>Loading...</span></div>");
        let jwtToken = this.Auth.getRightSocialToken();

        axios({
            url: `${BACKEND_API_URL}/twitter/search/tweets/${jwtToken}`,
            method: 'POST',
            data: searchInputString,
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            }
        }).then(response => {
            if(response.status !== 200) {
                swal("Error", "Internal server error", "error");
            } else {
                props.addNewTweet(response.data);
            }
        }).catch(err => {
            console.log(err);
        });
    }
}
